void sgl_draw_awesome23(sgl_surf_t *surf, int hex_idx, int x, int y, sgl_color_t color, sgl_color_t bg_color)
{
    hex_idx -= 0xf000;
    const uint8_t *dot = &sgl_awesomw_h23_bitmap[sgl_awesome_h23[hex_idx].bitmap_index];
    for(int i = 0; i < sgl_awesome_h23[hex_idx].height; i++) {
        for(int j = 0; j < sgl_awesome_h23[hex_idx].width; j +=2) {
          sgl_draw_point(surf, x + j + sgl_awesome_h23[hex_idx].ofs_x, y + i + sgl_awesome_h23[hex_idx].ofs_y, sgl_color_mixer(color, bg_color, (((*dot)>>4)&0xF)*16));
          sgl_draw_point(surf, x + j + sgl_awesome_h23[hex_idx].ofs_x + 1, y + i + sgl_awesome_h23[hex_idx].ofs_y, sgl_color_mixer(color, bg_color, (((*dot))&0xF)*16));
          dot ++;
        }
    }
}

